import 'bootstrap/dist/css/bootstrap.css';

function EditExcel() {

    return (
        <div>
            <form class="m-5">
                <div class="mb-3">
                    <input type="actionType" class="form-control" placeholder='Action Type'></input>
                </div>
                <div class="mb-3">
                    <input type="actionName" class="form-control" place></input>
                </div>
                <button type="submit" class="btn btn-primary">Save</button>
            </form>
        </div>
    );
}

export default EditExcel;
